import React, { Component } from "react";
import TodoContainer from "./containerComponents/TodoContainer";
import SignUpView from "./textComponents/SignUpView";
import { BrowserRouter, Route } from "react-router-dom";

const style = {
  container: {
    height: "100vh",
    width: "100%",
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
  }
};

export class Main extends Component {
  state = {
    loggedIn: false
  };

  render() {
    console.log(this.state.loggedIn)
    return (
      <BrowserRouter>
        <div style={style.container}>
          <Route path="/" component={SignUpView} exact />
          <Route path="/home" render={ (loggedIn) => <SignUpView {...loggedIn} loggedIn={true} />} />
        </div>
      </BrowserRouter>
    );
  }
}

export default Main;
